import React from "react";
import { userStore } from "../../stores/UserStore";
import "./Header.css";

const Header = () => {
  const username = userStore((state) => state.username)
  return (
    <div id="header-div">
      <div id="welcome-div">
        <p id="welcome-note">
          <span id="display-username">Welcome, {username}</span>

        </p>
      </div>
      <div id="nav-div"></div>
    </div>
  );
}

export default Header;
